
fn main() {
    //println!("{}", INPUT);
    for chr in ('a' as i32)..=('z' as i32)
    {
        let mut chars = INPUT.chars().collect::<Vec<char>>();

        let mut last = chars.len();
        let mut idx = 0;

        while idx < last
        {
            let mut increase = true;
            if chars[idx] as i32 == chr || chars[idx] as i32 == chr-32
            {
                chars.remove(idx);
                last = last-1;
                increase = false;
            }
            if increase
            {
                idx = idx+1;
            }
        }

        print!("{}: ", chr as u8 as char);
/*
        for i in 0..chars.len()
        {
            print!("{}", chars[i]);
        }
        print!(" ");
*/
        let mut any_action = true;
        while any_action
        {
            any_action = false;
            for idx in 1..chars.len()
            {
                if (chars[idx-1] as i32 == (chars[idx] as i32)+32) ||
                (chars[idx-1] as i32 == (chars[idx] as i32)-32)
                {
                    any_action = true;
                    //println!("Removed {}{}", chars[idx-1], chars[idx]);
                    chars.remove(idx);
                    chars.remove(idx-1);

                    break;
                }
            }
        }

        println!("{}", chars.len());
    }
}

//const INPUT: &'static str = "dabAcCaCBAcCcaDA";

const INPUT: &'static str = "";
